import { GoogleMap, useLoadScript, Marker } from '@react-google-maps/api';


const center = {lat:1.3046688076702777, lng: 103.80008079564587}
const Maps = () => {
    
    const {isLoaded} = useLoadScript({
        googleMapsApiKey: "AIzaSyCUvExdvtB4lKu2IJjTfBka8254ImunKnk",
    });
    const { error, isPending, data: kisoks } = useFetch('http://localhost:8000/kiosk');
    console.log(kiosks);

    if(!isLoaded) return 
    { error && <div>{ error }</div> }
    { isPending && <div>Loading...</div> };
    return ( 
        <GoogleMap
            zoom={15}
            center={center}
            mapContainerClassName='map-container'
        >   
            <Marker position={{lat:1.3046688076702777, lng: 103.80008079564587}} />
      </GoogleMap>
     );
}
 
export default Maps;
